import React from 'react';
import './HistoryPage.css';

const HistoryPage = () => {
    return (
        <div className="history-page">
            <h1>Our History</h1>
            <p>This is the history page for Holy Family Polymers.</p>
        </div>
    );
};

export default HistoryPage;
